pragma solidity ^0.8.0;

import "../ERC20/IERC20.sol";

contract Presale{

    struct SaleInfor{
        address payable presaleOwner;
        IERC20 saleToken;
        IERC20 baseToken;
        uint256 tokenPrice;
        uint256 startSale;
        uint256 endSale;
        uint256 valueSwapERC20;
        uint256 feeTransaction;
        uint256 minSpendPerBuyer;
        uint256 maxSpendPerBuyer;
        uint256 refundFee;
        uint256 claimFee;
    }

    struct BuyerInfo{
        address payable buyer;
        uint256 baseDeposit;
        uint256 tokenOwner;
        uint256 lastWithDraw;
        uint256 totalTokenWithDraw;
        bool isRefund;
        bool isClaim;
    }

    struct PresaleStatus {
        uint256 totalBaseCollected;
        uint256 totalTokenSold;
        uint256 totalTokenWithDraw;
        uint256 totalBaseWithDraw;
        uint256 numByer;
        uint256 totalFee;
    }
    
    mapping(address => BuyerInfo) public buyerInfo;
    mapping(address => uint256) public userFee;
    PresaleStatus public STATUS;

    function initialSaleInfor(
        address payable _presaleOwner,
        IERC20 _saleToken,
        IERC20 _baseTOken
    ) external {

    }
}

